import React, { Component } from 'react'
import Item from './Item'

class Items extends Component {
    constructor(){
        super()
        this.state = {
            selected: false
        }
    }

    onClick = () => {
        this.setState({selected: !this.state.selected})
    }

    render () {
        const items = []
        for (let i = 0; i < 5; i++) {
            items[i] = <Item key={i} selected={this.state.selected} onClick={this.onClick}/>
        }

        return (
            <React.Fragment>
                items
                <Item key={1} selected={this.state.selected} onClick={this.onClick}/>
                <Item key={2} selected={this.state.selected} onClick={this.onClick}/>
           </React.Fragment>
        )
    }
}

export default Items
